import React from 'react';

class Options extends React.Component {
    render() {
        const optionList = Object.keys(this.props.featuresAvailable[option]).map((option) => {
            return <Option option={option} />
        })
        return (
            <div>
                {optionList}
            </div>
        );
    }
}

export default Options;
